import { useNavigate } from "react-router-dom";
import { useEffect } from "react";
const Allphotos=()=>{
    const navigate = useNavigate();
    useEffect(() => {
      if (!localStorage.getItem("token")) {
        navigate('/signup');
      }
    }, [navigate]);
    return (<>
    All pics
    </>)
}
export default Allphotos;
